import {
  Button,
  Box
} from "@mui/material";

import {
  ThemeProvider,
  createTheme
} from "@mui/material/styles";
import { red, cyan, yellow, amber} from "@mui/material/colors";
const MaterialColorTheme = ()=>{

  const custom = createTheme({
    palette:{
      primary: red,
      secondary: cyan,
      error: yellow,
      info: amber,
      warning: orange
    }
  });

  const design = (
    <>
      <ThemeProvider theme={custom}>
        <Button size="large" variant="contained" color="error">SUBMIT</Button>
        <Box sx={{
          width:"300px",
          height:"200px",
          background:"info"}}></Box>
      </ThemeProvider>
      <Button variant="contained" color="primary"></Button>
    </>
  );
  return design;
}

export default MaterialColorTheme;
